import { FastField } from "formik";
import React from "react";

export const Radiobtn = () => {
  return (
    <div>
      <FastField>
        {() => (
          <>
            <div class="control d-flex align-items-center">
              <span></span>
              <label class="radio">
                <input type="radio" name="answer" />
                Yes
              </label>
              <label class="radio">
                <input type="radio" name="answer" />
                No
              </label>
            </div>
          </>
        )}
      </FastField>
    </div>
  );
};
